package ComputerProgrammingPartOne;

public class Program4_10 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n, i;

		for (i = 1; i <= 20; i++) {
			for (n = 1; n <= 10; n++) {
				System.out.printf("%d X %d = %d\n", i, n, i * n);
			}
			System.out.printf("\n");
		}
	}

}
